// dummyData.js
const dummyData = {
  products: [
    {
      id: 1,
      name: "Product 1",
      description: "Description of Product 1",
      price: 10.99,
      quantity: 100,
    },
    {
      id: 2,
      name: "Product 2",
      description: "Description of Product 2",
      price: 20.49,
      quantity: 50,
    },
    {
      id: 3,
      name: "Product 3",
      description: "Description of Product 3",
      price: 15.75,
      quantity: 75,
    },
  ],
};

export default dummyData;
